import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import SignalsContainer from '../components/SignalsContainer';
import Header from '../components/Header';
import LPage from '../screens/LPage';
import Login from '../screens/LoginScreen';

const Dashboard = React.lazy(() => import('../screens/Dashboard'));
const Settings = React.lazy(() => import('../screens/Settings'));
const Support = React.lazy(() => import('../screens/Support'));
const Profile = React.lazy(() => import('../screens/Profile'));

const ProtectedRoute = ({ children, signals }) => {
  const token = localStorage.getItem('token');
  if (!token) {
    return <Navigate to="/login" />;
  }
  return (
    <>
      <Header signals={signals} />
      {children}
    </>
  );
};

const AppRoutes = ({ signals }) => {
  return (
    <React.Suspense fallback={<div>Carregando...</div>}>
      <Routes>
        <Route path="/" element={<LPage />} />
        <Route path="/login" element={<Login />} />
        <Route 
          path="/signals" 
          element={
            <ProtectedRoute signals={signals}>
              <SignalsContainer signals={signals} />
            </ProtectedRoute>
          } 
        />
        <Route path="/dashboard" element={<ProtectedRoute><Dashboard /></ProtectedRoute>} />
        <Route path="/settings" element={<ProtectedRoute><Settings /></ProtectedRoute>} />
        <Route path="/support" element={<ProtectedRoute><Support /></ProtectedRoute>} />
        <Route path="/profile" element={<ProtectedRoute><Profile /></ProtectedRoute>} />
      </Routes>
    </React.Suspense>
  );
};

export default AppRoutes;
